(22, 22, 'Amsterdam\'s name derives from Amstelredamme,[15] indicative of the city\'s origin around a dam in the river Amstel. Originating as a small fishing village in the late 12th century, Amsterdam became one of the most important ports in the world during the Dutch Golden Age (17th century), a result of its innovative developments in trade. During that time, the city was the leading centre for finance and diamonds.[16] In the 19th and 20th centuries the city expanded, and many new neighbourhoods and suburbs were planned and built. The 17th-century canals of Amsterdam and the 19‚Äì20th century Defence Line of Amsterdam are on the UNESCO World Heritage List. Since the annexation of the municipality of Sloten in 1921 by the municipality of Amsterdam, the oldest historic part of the city lies in Sloten', 'Apart from being regarded as the City of Music[16] because of its musical legacy, Vienna is also said to be \"The City of Dreams\" because it was home to the world\'s first psychotherapist ‚Äì Sigmund Freud.[17] The city\'s roots lie in early Celtic and Roman settlements that transformed into a Medieval and Baroque city, and then the capital of the Austro-Hungarian Empire. It is well known for having played an essential role as a leading European music centre, from the great age of Viennese Classicism through the early part of the 20th century. The historic centre of Vienna is rich in architectural ensembles, including Baroque castles and gardens, and the late-19th-century Ringstra√üe lined with grand buildings, monuments and parks.[18]'),
